Object.Field:
The AUTO_CONFIGURATION option provides automatic configuration of the Oracle database and ensures that all prerequisites are met. Note that some of these parameters cannot be changed without restarting the database. You should check the Create Journal step in the ODI execution log to detect configurations tasks not performed correctly (Warning status).
When using the AUTO_CONFIGURATION option, the connecting user must be granted the DBA role. This user must also be a granted the Streams Administrator privilege. This option changes some database settings dynamically when possible. This requires to have a database using a SPFILE.
In order to grant the DBA role, connect as SYSDBA and run the following statement: GRANT DBA TO <TheUserName>;
In order to grant the Streams Administrator privilege, connect as SYSDBA and run the following statement: BEGIN DBMS_STREAMS_AUTH.GRANT_ADMIN_PRIVILEGE( grantee => '<TheUserName>', grant_privileges => true); END;
In order to set your database using a SPFILE, connect as SYSDBA and run the following statement: CREATE SPFILE FROM PFILE='<The Full Path to your init.ora file>';
When AUTO_CONFIGURATION is set to Yes, the following checks/settings are performed: - Check the DBA role to the connection user - Check that the connection user is a Streams Administrator - Check that Oracle Streams is installed - Check that the database runs using a SPFILE - Check that the database runs in Archivelog mode - Check that the database or the source tablespace is configured with the force logging option - Check the value of AQ_TM_PROCESSES bein either left to the database default value or set to a value different from 0 and 10. - Check that all the journalized tables have a primary key defined in the the ODI model - Check that all the journalized tables contain only supported datatypes by Oracle Streams - Check that all the journalized tables contain only supported datatypes in their primary keys - Grant the SELECT ANY TABLE privilege to the Work Schema - Grant the RESOURCE role to the Work Schema - Configures the source tablespaces with the force logging option if required - Set UNDO_RETENTION to 3600 is the value is lower - Set the value of STREAM_POOL_SIZE if the minimum requirement is not met (*) - Add Supplemental Logging on all the columns of the primary keys of the journalized tables
(*) Refer to the description of CONFIGURATION_TYPE for more information on the minimum requirements

