DECLARE
	nb_rows NUMBER;
BEGIN
	select	count(*) 
	into	nb_rows
	from	DBA_STREAMS_ADMINISTRATOR
	where	USERNAME		= upper('<%= odiRef.getInfo("DEST_USER_NAME")%>');

	IF nb_rows = 0 THEN
		raise_application_error(-20101, 'ODIKM-ORA-JKM-10007: User <%= odiRef.getInfo("DEST_USER_NAME")%> must be Administrator for Oracle Streams. Refer to the description of the AUTO_CONFIGURATION option for more information');
	END IF;
END;

DECLARE
	nb_rows NUMBER;
BEGIN
	select	count(*) 
	into	nb_rows
	from	V$PARAMETER
	where	upper(NAME)	= 'AQ_TM_PROCESSES'
	and	not (ISDEFAULT = 'TRUE' and ISMODIFIED = 'FALSE')
	and	VALUE in ('0', '10');

	IF nb_rows = 1 THEN
		raise_application_error(-20101, 'ODIKM-ORA-JKM-10004: System Parameter AQ_TM_PROCESSES should be either left to default value or set to a value different from 0 and 10.');
	END IF;
END;

