DECLARE
	TYPE col_def is record (
		col_name	VARCHAR2(30)
	);
	TYPE col_def_list is table of col_def;

	v_nbrows		NUMBER;
	v_col_def_list	col_def_list;
	v_cpt		NUMBER;
BEGIN
	v_col_def_list := col_def_list(<%=odiRef.getColList("", "NULL", ", ", "", "PK")%>);
	v_cpt := 1;
	<%=odiRef.getColList("", "v_col_def_list(v_cpt).col_name := '[COL_NAME]';\n\tv_cpt := v_cpt + 1;", "\n\t", "", "PK")%>

	FOR i IN v_col_def_list.FIRST..v_col_def_list.LAST LOOP
		SELECT	count(*)
		INTO	v_nbrows
		FROM	dba_log_group_columns
		WHERE	owner||'.'||table_name = '<%=odiRef.getJrnInfo("FULL_TABLE_NAME")%>'
		AND	column_name = v_col_def_list(i).col_name
		AND	logging_property = 'LOG';

		IF v_nbrows = 0 THEN
			raise_application_error(-20101, 'ODIKM-ORA-JKM-10000: The column <%=odiRef.getJrnInfo("FULL_TABLE_NAME")%>.'|| v_col_def_list(i).col_name || ' must have supplemental logging defined.');
		END IF;
	END LOOP;
END;

DECLARE
	v_db_logging	NUMBER;
	v_tbs_logging	NUMBER;
	v_tbs_name		VARCHAR2(30);
BEGIN
	SELECT	count(*)
	INTO	v_db_logging
	FROM	v$database
	WHERE	force_logging = 'YES';

	IF v_db_logging = 1 THEN
		/* Database is in force logging, nothing to do */
		NULL;
	ELSE
		SELECT	count(*)
		INTO	v_tbs_logging
		FROM	dba_tablespaces	TBS,
			dba_tables		TBL
		WHERE	TBS.force_logging = 'YES'
		AND	TBL.tablespace_name = TBS.tablespace_name
		AND	TBL.owner || '.' || TBL.table_name = '<%=odiRef.getJrnInfo("FULL_TABLE_NAME")%>';

		IF v_tbs_logging = 0 THEN
			SELECT	TBS.tablespace_name
			INTO	v_tbs_name
			FROM	dba_tablespaces	TBS,
				dba_tables		TBL
			WHERE	TBL.tablespace_name = TBS.tablespace_name
			AND	TBL.owner || '.' || TBL.table_name = '<%=odiRef.getJrnInfo("FULL_TABLE_NAME")%>';

			execute immediate 'alter tablespace ' || v_tbs_name || ' force logging';
		END IF;
	END IF;
END;

DECLARE
	v_db_logging	NUMBER;
	v_tbs_logging	NUMBER;
BEGIN
	SELECT	count(*)
	INTO	v_db_logging
	FROM	v$database
	WHERE	force_logging = 'YES';

	IF v_db_logging = 1 THEN
		/* Database is in force logging, nothing to do */
		NULL;
	ELSE
		SELECT	count(*)
		INTO	v_tbs_logging
		FROM	dba_tablespaces	TBS,
			dba_tables		TBL
		WHERE	TBS.force_logging = 'YES'
		AND	TBL.tablespace_name = TBS.tablespace_name
		AND	TBL.owner || '.' || TBL.table_name = '<%=odiRef.getJrnInfo("FULL_TABLE_NAME")%>';

		IF v_tbs_logging = 0 THEN
			raise_application_error(-20101, 'ODIKM-ORA-JKM-10001: The database and the tablespace of table <%=odiRef.getJrnInfo("FULL_TABLE_NAME")%> are not in FORCE_LOGGING mode. Aborting.');
		END IF;
	END IF;
END;

