DECLARE
	TYPE col_def is record (
		col_name	VARCHAR2(30),
		col_dt	VARCHAR2(250)
	);
	TYPE col_def_list is table of col_def;

	dml_rule_name	<%=odiRef.getJrnInfo("CDC_OBJECTS_TABLE")%>.FULL_OBJECT_NAME%TYPE;
	ddl_rule_name	<%=odiRef.getJrnInfo("CDC_OBJECTS_TABLE")%>.FULL_OBJECT_NAME%TYPE;
	iscn		<%=odiRef.getJrnInfo("CDC_SET_TABLE")%>.CUR_WINDOW_ID%TYPE;
	iglobal_name 	GLOBAL_NAME.GLOBAL_NAME%TYPE;
	v_nbrows		NUMBER;
	v_col_def_list	col_def_list;
	v_cpt		NUMBER;
BEGIN
	v_col_def_list := col_def_list(<%=odiRef.getColList("", "NULL", ", ", "", "NOT PK")%>);
	v_cpt := 1;
	<%=odiRef.getColList("", "v_col_def_list(v_cpt).col_name := '[COL_NAME]';\n\tv_col_def_list(v_cpt).col_dt := '<?= removeParenthesis(" + '"' + "[DEST_DT]" + '"' + ") ?>';\n\tv_cpt := v_cpt + 1;", "\n\t", "", "NOT PK")%>

	select CUR_WINDOW_ID into iscn from <%=odiRef.getJrnInfo("CDC_SET_TABLE")%> where CDC_SET_NAME = '<%=odiRef.getObjectName("L", odiRef.getJrnInfo("JRN_COD_MOD"), "D")%>';

	select GLOBAL_NAME into iglobal_name from GLOBAL_NAME;

	select	count(*)
	into	v_nbrows
	from	<%=odiRef.getObjectName("L" ,"SNP_TMP_TABLE_LIST" , "W")%>	<%= odiRef.getInfo("DEST_TAB_ALIAS_WORD") %> TMP
	where	TMP.FULL_TABLE_NAME = '<%=odiRef.getJrnInfo("FULL_TABLE_NAME")%>'
	and	not exists 	(
			select	'X'
			from	<%=odiRef.getJrnInfo("CDC_OBJECTS_TABLE")%>	<%=odiRef.getInfo("DEST_TAB_ALIAS_WORD")%> OBJ,
				<%=odiRef.getJrnInfo("CDC_TABLE_TABLE")%>	<%=odiRef.getInfo("DEST_TAB_ALIAS_WORD")%> TBL
			where	TBL.FULL_TABLE_NAME		= OBJ.FULL_TABLE_NAME
			and	TBL.FULL_TABLE_NAME		= TMP.FULL_TABLE_NAME
			and	TBL.CDC_SET_NAME		= '<%=odiRef.getObjectName("L", odiRef.getJrnInfo("JRN_COD_MOD"), "D")%>'
			and	OBJ.CDC_OBJECT_TYPE		= 'CAPTURE TABLE RULE'
			);
	IF (v_nbrows > 0) THEN
		DBMS_STREAMS_ADM.ADD_TABLE_RULES(
			table_name		=>  '<%= odiRef.getJrnInfo("FULL_TABLE_NAME") %>',
			streams_type	=>  'CAPTURE',
			streams_name	=>  'ODI_<%= odiRef.getOption("STREAMS_OBJECT_GROUP") %>_C',
			queue_name		=>  '<%= odiRef.getInfo("DEST_USER_NAME")%>.ODI_<%= odiRef.getOption("STREAMS_OBJECT_GROUP") %>_Q',
			include_dml		=>  true,
			include_ddl		=>  false,
			dml_rule_name	=>  dml_rule_name,
			ddl_rule_name	=>  ddl_rule_name,
			inclusion_rule	=>  true);
		FOR i IN v_col_def_list.FIRST..v_col_def_list.LAST LOOP
			IF ((v_col_def_list(i).col_dt = 'LONG') OR (v_col_def_list(i).col_dt = 'LONG RAW')) THEN
				DBMS_STREAMS_ADM.DELETE_COLUMN(
					rule_name		=> dml_rule_name,
					table_name		=>  '<%= odiRef.getJrnInfo("FULL_TABLE_NAME") %>',
					column_name	=> v_col_def_list(i).col_name);
			END IF;
		END LOOP;

		DBMS_APPLY_ADM.SET_TABLE_INSTANTIATION_SCN(
			source_object_name	=> '<%= odiRef.getJrnInfo("FULL_TABLE_NAME") %>',
			source_database_name	=> iglobal_name,
			instantiation_scn	=> iscn);

		insert into <%=odiRef.getJrnInfo("CDC_OBJECTS_TABLE")%>
		(
			FULL_TABLE_NAME,
			CDC_OBJECT_TYPE,
			FULL_OBJECT_NAME,
			DB_OBJECT_TYPE
		)
		values
		(
			/* FULL_TABLE_NAME */	'<%=odiRef.getJrnInfo("FULL_TABLE_NAME")%>',
			/* CDC_OBJECT_TYPE */	'CAPTURE TABLE RULE',
			/* FULL_OBJECT_NAME */	dml_rule_name,
			/* DB_OBJECT_TYPE */	'CAPTURE TABLE RULE'
		);
	ELSE
		/* Table rule already created */
		NULL;
	END IF;
END;

