end;

CREATE OR REPLACE PACKAGE BODY <%=odiRef.getJrnInfo("JRN_FULL_TRIGGER")%> AS
PROCEDURE ODI_INSERT_HANDLER (in_any IN ANYDATA)
IS
	lcr   SYS.LCR$_ROW_RECORD;
	rc    PLS_INTEGER;
 BEGIN
	-- Access the LCR
	rc := in_any.GETOBJECT(lcr);
	-- Insert information about the LCR into the history_row_lcrs table
	INSERT INTO <%=odiRef.getJrnInfo("JRN_FULL_NAME")%>
	(<%=odiRef.getColList("", "[COL_NAME]", ",\n\t\t", "", "PK")%>,
	WINDOW_ID)
	VALUES 
	(<%=odiRef.getColList("", "lcr.GET_VALUE('NEW', '[COL_NAME]').<?= getAccessMethodName(" + '"' + "[DEST_DT]" + '"' +  ") ?>()", ",\n\t\t", "", "PK")%>,
	lcr.get_commit_scn);
END;

PROCEDURE ODI_UPDATE_HANDLER (in_any IN ANYDATA)
IS
	lcr	SYS.LCR$_ROW_RECORD;
	rc	PLS_INTEGER;
	key_chg	BOOLEAN;
 BEGIN
	-- Access the LCR
	rc := in_any.GETOBJECT(lcr);
	key_chg := FALSE;
	<%=odiRef.getColList("", "IF (lcr.GET_VALUE('NEW', '[COL_NAME]', 'N') IS NOT NULL) THEN\n\t\tkey_chg := TRUE;\n\tEND IF;", "\n\n\t", "", "PK")%>

	-- Insert information about the LCR into the history_row_lcrs table
	INSERT INTO <%=odiRef.getJrnInfo("JRN_FULL_NAME")%>
	(<%=odiRef.getColList("", "[COL_NAME]", ",\n\t\t", "", "PK")%>,
	WINDOW_ID)
	VALUES 
	(<%=odiRef.getColList("", "lcr.GET_VALUE('OLD', '[COL_NAME]').<?= getAccessMethodName(" + '"' + "[DEST_DT]" + '"' +  ") ?>()", ",\n\t\t", "", "PK")%>,
	lcr.get_commit_scn);

	IF (key_chg) THEN
		INSERT INTO <%=odiRef.getJrnInfo("JRN_FULL_NAME")%>
		(<%=odiRef.getColList("", "[COL_NAME]", ",\n\t\t", "", "PK")%>,
		WINDOW_ID)
		VALUES 
		(<%=odiRef.getColList("", "lcr.GET_VALUE('NEW', '[COL_NAME]', 'Y').<?= getAccessMethodName(" + '"' + "[DEST_DT]" + '"' +  ") ?>()", ",\n\t\t", "", "PK")%>,
		lcr.get_commit_scn);
	END IF;	
END;

