DECLARE
	nb_rows NUMBER;
BEGIN
	select	count(*) 
	into	nb_rows
	from	USER_ROLE_PRIVS
	where	USERNAME		= upper('<%= odiRef.getInfo("DEST_USER_NAME")%>')
	and	GRANTED_ROLE	= 'DBA';

	IF nb_rows = 0 THEN
		raise_application_error(-20101, 'ODIKM-ORA-JKM-10007: User <%= odiRef.getInfo("DEST_USER_NAME")%> must be granted the DBA role. Refer to the description of the AUTO_CONFIGURATION option for more information');
	END IF;
END;

DECLARE
	nb_rows NUMBER;
BEGIN
	select	count(*) 
	into	nb_rows
	from	V$PARAMETER
	where	upper(NAME)	= 'SPFILE'
	and	length(nvl(value, ''))	> 0;

	IF nb_rows = 0 THEN
		raise_application_error(-20101, 'ODIKM-ORA-JKM-10006: The database must use a SPFILE. Refer to the description of the AUTO_CONFIGURATION option for more information');
	END IF;
END;

DECLARE
	nb_rows NUMBER;
BEGIN
	select	count(*) 
	into	nb_rows
	from	V$OPTION
	where	PARAMETER	= 'Streams Capture'
	and	VALUE	= 'TRUE';

	IF nb_rows = 0 THEN
		raise_application_error(-20101, 'ODIKM-ORA-10002: Oracle Streams is not installed on the database. Contact your DBA to have this option installed on your database.');
	END IF;
END;

